// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.0;
pragma experimental ABIEncoderV2;
import "./Utils.sol";
contract Drugs is Utils{

    constructor() {
        //DrugOwner = msg.sender;
    }

    modifier onlyDrugOwner() {
        address DrugOwner;
        require(DrugOwner == msg.sender);
        _;
    }

    function CreateDrug(
        string memory _regno,
        string memory _drugname
    ) public returns (bool) {
        DrugRegNoMapping[_regno] = Drug(
            _drugname,
            msg.sender,
            Statuses.New
        );
        DrugsRegNos.push(_regno);
        return true;
    }

    function SetDrugStatus(string memory _regno)
        public
        returns (bool)
    {
        require (ReadDrug(_regno).Manufacturer == msg.sender);
        DrugRegNoMapping[_regno].DrugStatus = Statuses.Suspended;
        return true;
    }




}

contracts/Users.sol.content:
// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.0;
pragma experimental ABIEncoderV2;
import "./Utils.sol";
contract Users is Utils {
    
    function CreateUser(
        string memory _id,
        string memory _username,
        UserRoles _userrole,
        uint256 _lat,
        uint256 _long
    ) public returns (bool) {
        Statuses _activeUser;
        if(_userrole == UserRoles.Physician || _userrole == UserRoles.Patient){
            _activeUser = Statuses.Active;
        }
        else{
            _activeUser = Statuses.New;
        }
        UserIDsMapping[_id] = User(
            _username,
            UserRoles(_userrole),
            _activeUser,
            _lat,
            _long,
            msg.sender
        );
        UsersIDs.push(_id);
        return true;
    }

}

contracts/Regulator.sol.content:
// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.0;
pragma experimental ABIEncoderV2;

import "./Utils.sol";
contract Regulator is Utils {
    
    address public Owner;
    
    constructor() {
        Owner = msg.sender;
    }
    
    modifier onlyOwner() {
        require(Owner == msg.sender);
        _;
    }
    //Users 
    function ReadUser(string memory _id) public view returns (User memory) {
        return UserIDsMapping[_id];
    }

    function SetUserStatus(string memory _id, Statuses _status)
        public
        onlyOwner 
        returns (bool)
    {
        UserIDsMapping[_id].UserStatus = _status;
        return true;
    }
 
    function GetUsersByType(UserRoles _role)
        public
        view
        returns (User[] memory filteredUsers)
    {
        uint256 usersCount = UsersIDs.length;
        User[] memory usersTemp = new User[](usersCount);
        uint256 count;
        for (uint256 i = 0; i < usersCount; i++) {
            if (UserIDsMapping[UsersIDs[i]].UserRole == _role) {
                usersTemp[count] = UserIDsMapping[UsersIDs[i]];
                count += 1;
            }
        }

        filteredUsers = new User[](count);
        for (uint256 i = 0; i < count; i++) {
            filteredUsers[i] = usersTemp[i];
        }
    }
    

    function SetDrugStatus(string memory _regno, Statuses _status)
        public
        onlyOwner 
        returns (bool)
    {
        DrugRegNoMapping[_regno].DrugStatus = _status;
        return true;
    }
}

contracts/Utils.sol.content:
// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.0;
pragma experimental ABIEncoderV2;

contract Utils{
    //Shared
    enum Statuses{
        New,
        Active,
        Suspended
    }
    //Users
    enum UserRoles {
        Mnufacturer,
        Transporter,
        Wholesaler,
        Hospital,
        Pharmacy,
        Physician,
        Patient
    }
    struct User {       
        string UserName;
        UserRoles UserRole;
        Statuses UserStatus;
        uint256 Latitude;
        uint256 Longitude;
        address UserAddress;
    }
    mapping(string => User) UserIDsMapping;
    string[] UsersIDs;
    //Drugs
    struct Drug {
        string DrugName;
        address Manufacturer;
        Statuses DrugStatus;
    }
    enum DrugTypes {
        HumanPharmaceutical,
        Biological,
        HerbalMedicine,
        Veterinary,
        Biocides,
        Cosmetics,
        DietarySupplement
    }
    mapping(string => Drug) DrugRegNoMapping;
    string[] DrugsRegNos;

    //Drugs
    function ReadDrug(string memory _regno) public view returns (Drug memory) {
        return DrugRegNoMapping[_regno];
    }
}

